printf("ESC: what port on %s? ", &ip_addr_esc); fflush(stdout);
then instead of the cursor sitting at the end of the line after the "?", it is sitting some arbitrary place.  As soon as I hit a key on input, the cursor does move to the expected location at the end of the line. 
Expected Behavior:  The cursor should move to the end of the latest output immediately after receipt.  
Steps to Reproduce: Have a program do the equivalent of:
char line[100];
unsigned int ESC_port;
int steps;
char *p = NULL;
printf("ESC: host IP address (type - for localhost = %s)? ", myIP); fflush(stdout);
scanf("%s", &line);
p = line;
while(*p == ' ') p++;
if(strcmp(p, "exit") == 0) break;
if(strcmp(p, "-") == 0) p = myIP; // default to localhost
strcpy(ip_addr_esc, p);
printf("ESC: what port on %s? ", &ip_addr_esc); fflush(stdout);
ESC_port = 0;
scanf("%d", &ESC_port);
if(ESC_port == 0) ESC_port = ECC_PORT_NO;
printf("ESC: port %d, how many steps? ", ESC_port); fflush(stdout);
scanf("%d", &steps);
if(steps <= 0) break;

Yes, the parser isn't handling the case of "1..10" very well.  However, with spaces, it works.  For example:

    Sequence{1, 3 .. (n+1), n * 2}

Of course, spaces shouldn't be required.  The following also works:

    Sequence{(n+1)..(n*2)}

So, it looks like an ambiguity with the numeric operation call (e.g., "3.oclIsKindOf(Integer)"), which is implemented as a special case in the grammar to distinguish it from Real literals (e.g., "2.1728").  I think.

Committed a fix.  The parser can now handle any of:

    Sequence{1 .. 10} 
    Sequence{0, n..n*2} 
    Sequence{1..10} 
    Sequence{-10, -1..1, 10}

