Simplified test case with some comments.

And so the journey continues ... After much hunting I finally have a True Simple Testcase, which shows the problem.  Which I have attached.

And its a nasty one - I tracked it down to it showing up because I had referenced a certain boost header.  Drilling down through about 12 layers of header files, I finally found a rather nasty looking thing, which when put into my simple testcase, broke it.
The issue appears to be that unfortunately the preprocessor used for content assist isn't omnipotent, such a shame that! 

What happens is 

#if !(ModeratelyComplexCondition)
namespace a {
namespace b {
#else
namespace a {
namespace c {
namespace d {
#endif
...
#if DifferentButActuallyPracticallyEquivelentModeratelyComplexCondition
}
}
namespace b {
#endif

which leaves the parser unsure as to what the namespace is I guess.
Two issues 1) Boost screwed up in that the two preprocessor tests aren't Obvious negations of each other, this is a bug in boost.
2) even if you make the two conditions the same, it still doesn't work.  This appears to be due to additional brackets arround the condition in the negated vs non-negated version.  I tried with #if (A==3) and #if !(A==3) instead of the boost stuff, and it worked for me.

A break is clearly missing after the line:
	decl = mq.getCMAttributeDeclaration((Attr) node);


Full method shown below:

	public static CMNode getDeclaration(Node node) {
		CMNode decl = null;
		ModelQuery mq = null;
		switch (node.getNodeType()) {
		case Node.ATTRIBUTE_NODE: {
			mq = ModelQueryUtil.getModelQuery(((Attr) node).getOwnerDocument());
			decl = mq.getCMAttributeDeclaration((Attr) node);
			// MISSING BREAK??
		}
		case Node.ELEMENT_NODE: {
			mq = ModelQueryUtil.getModelQuery(node.getOwnerDocument());
			decl = mq.getCMElementDeclaration((Element) node);
		}
		}
		return decl;
	}

