It is currently not possible to change the location URI for the EFS support if the current location is a null URI.  Assuming a project description with a location of NULL implying a local file system, attempts to set to a different location URI fails in the check for ProjectDescription#hasPrivateChanges.  The line:

		IPath otherLocation = description.getLocation();

Always returns null.  This really should be a comparison of the location URI rather than the location.  With this check it is impossible to switch the file system from null.  Although this seems like a strange thing to want to do once it is on disk, this is a useful thing to do and the API should support the change.

